import React from 'react';
import { Link } from 'react-router-dom';
import styled from 'styled-components';
import Contact from '../pages/Contact';

const barContainer = styled.bar`
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding: 1rem 2rem;
  background-color: #6c63ff;
  color: white;
`;

const barLinks = styled.div`
  display: flex;
  gap: 1.5rem;
`;

const barLink = styled(Link)`
  color: white;
  text-decoration: none;
  font-weight: bold;
  &:hover {
    color: #f0f0f0;
  }
`;

const barBar = () => {
  return (
    <barContainer>
      <h1>My Blog</h1>
      <barLinks>
        <barLink to="/">Home</barLink>
        <barLink to="/blogs">Blogs</barLink>
        <barLink to="/about">About</barLink>
        <barLink to="/contact">Contact</barLink>
        <barLink to="/login">Sign In</barLink>
        <barLink to="/register">Register</barLink>
      </barLinks>
    </barContainer>
  );
};

export default barBar;
